import React, { useState, useEffect } from "react";
import { Link } from "react-router-dom";
import './index.css';
import Typography from '@material-ui/core/Typography';

export default function WeatherDetails(props) {
  const [city, setCity] = useState(sessionStorage.getItem("0"));
  const [weatherData, setWeatherData] = useState({
  "coord": {
    "lon": 0,
    "lat": 0
  },
  "weather": [
    {
      "id": 0,
      "main": "",
      "description": "",
      "icon": ""
    }
  ],
  "base": "",
  "main": {
    "temp": 0,
    "feels_like": 0,
    "temp_min": 0,
    "temp_max": 0,
    "pressure": 0,
    "humidity": 0
  },
  "visibility": 0,
  "wind": {
    "speed": 0,
    "deg": 0
  },
  "clouds": {
    "all": 0
  },
  "dt": 0,
  "sys": {
    "type": 0,
    "id": 0,
    "message": 0,
    "country": "",
    "sunrise": 0,
    "sunset": 0
  },
  "timezone": 0,
  "id": 0,
  "name": "",
  "cod": 0
});

  useEffect(() => {
    if(props.location.city) {
      setCity(props.location.city);
      sessionStorage.setItem("0", props.location.city);
    }
    fetchWeather();
  }, []);

  return (
    <div>
      <Link to="/" className="Button">Назад</Link>
      <Typography variant="h2">{city}</Typography>
    </div>
  );
}
